import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import { ReactKeycloakProvider } from '@react-keycloak/web';
import Keycloak from 'keycloak-js';
import App from './App';

const keycloak = new Keycloak({
  url: 'http://localhost:3000', // URL вашего сервера Keycloak
  realm: 'your-realm',         // Название вашего realm
  clientId: 'your-client-id',  // Ваш client_id
});

function KeycloakApp() {
  const [keycloakInitialized, setKeycloakInitialized] = useState(false);

  const onKeycloakEvent = (event) => {
    if (event === 'onAuthSuccess') {
      setKeycloakInitialized(true);
    }
  };

  const onKeycloakTokens = (tokens) => {
    // Обработайте токены, если нужно
  };

  return (
    <ReactKeycloakProvider
      authClient={keycloak}
      onEvent={onKeycloakEvent}
      onTokens={onKeycloakTokens}
    >
      <App keycloakInitialized={keycloakInitialized} />
    </ReactKeycloakProvider>
  );
}

ReactDOM.render(<KeycloakApp />, document.getElementById('root'));
